import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/Dashboard.css';
import { FaPlus, FaEye, FaWrench, FaTabletAlt, FaUserCircle, FaBell } from 'react-icons/fa';

const Dashboard = () => {
    let navigate = useNavigate();
    const userName = 'Yousra Karimi';  // Tu peux le récupérer dynamiquement

    return (
        <div className="dashboard-container">
            {/* Header Section */}
            <div className="header">
                <div className="user-info">
                    <FaUserCircle className="user-icon" />
                    <span>{userName}</span>
                </div>
                <FaBell className="notif-icon" />
            </div>

            {/* Button Grid */}
            <div className="button-grid">
                <button onClick={() => navigate('/addConfig')} className="dashboard-button">
                    <FaPlus size={50} />
                    <span>Add Configuration</span>
                </button>
                <button onClick={() => navigate('/viewConfigs')} className="dashboard-button">
                    <FaEye size={50} />
                    <span>See Configurations</span>
                </button>
                <button onClick={() => navigate('/myDevices')} className="dashboard-button">
                    <FaTabletAlt size={50} />
                    <span>My Devices</span>
                </button>
                <button onClick={() => navigate('/updateConfig')} className="dashboard-button">
                    <FaWrench size={50} />
                    <span>Update Configuration</span>
                </button>
            </div>
        </div>
    );
};

export default Dashboard;
